// icons.js
import {ReactComponent as Transmission} from  '../../../visuals/SVG/boite-de-vitesses.svg';
import  {ReactComponent as Key} from '../../../visuals/SVG/cle.svg';
import {ReactComponent as Fuel}  from  '../../../visuals/SVG/station-essence.svg';
import {ReactComponent as Mileage}  from '../../../visuals/SVG/compteur.svg';
import {ReactComponent as Stars}  from '../../../visuals/SVG/etoiles-de-noel.svg';
import {ReactComponent as Seat}  from '../../../visuals/SVG/siege-de-voiture.svg';
import {ReactComponent as Door}  from '../../../visuals/SVG/porte-de-voiture.svg';
import {ReactComponent as Painting}  from '../../../visuals/SVG/paint-brush.svg';

import {ReactComponent as Factory}  from '../../../visuals/SVG/industry.svg';
import {ReactComponent as HorsePower}  from '../../../visuals/SVG/horse-power.svg';






const Icons = {
    Transmission,
    Key,
    Fuel,
    Mileage,
    Stars,
    Seat,
    Door,
    Painting,
    Factory,
    HorsePower,
};

export default Icons;


